import { React, Component } from "react";
import "./TodoOld.css";
import axios from "axios";
import { Table, Tag, Space } from "antd";
import { EditTwoTone, DeleteTwoTone } from "@ant-design/icons";

class TodoNew extends Component {
  constructor() {
    super();

    this.state = { todoItems: [] };
  }

  componentDidMount() {
    axios
      .get("https://60b0f8b91f26610017fff943.mockapi.io/api/v1/todo_data")
      .then((res) => {
        this.setState({ todoItems: res.data });
      }).catch((err) => {
          console.log(err);
      });
  }

  render() {
    const columns = [
      {
        title: "id",
        dataIndex: "id",
        key: "id",
      },
      {
        title: "Title",
        dataIndex: "title",
        key: "title",
      },
      {
        title: "Is editing?",
        key: "isEditing",
        dataIndex: "tags",
        render: (tags) => (
          <>
            {tags.map((tag) => {
              let color;
              if (tag === "false") {
                color = "volcano";
              }
              if (tag === "true") {
                color = "green";
              }
              return (
                <Tag color={color} key={tag}>
                  {tag.toUpperCase()}
                </Tag>
              );
            })}
          </>
        ),
      },
      {
        title: "Is complete?",
        key: "isComplete",
        dataIndex: "tags",
        render: (tags) => (
          <>
            {tags.map((tag) => {
              let color;
              if (tag === "false") {
                color = "volcano";
              }
              if (tag === "true") {
                color = "green";
              }
              return (
                <Tag color={color} key={tag}>
                  {tag.toUpperCase()}
                </Tag>
              );
            })}
          </>
        ),
      },
      {
        title: "Action",
        key: "action",
        render: (text, record) => (
          <Space size="middle">
            <EditTwoTone />
            <DeleteTwoTone />
          </Space>
        ),
      },
    ];

    const data = [
      {
        id: "1",
        title: "John Brown",
        isEditing: "false",
        isCompelte: "true",
      },
      {
        id: "2",
        title: "Joe Mama",
        isEditing: "false",
        isCompelte: "true",
      },
      {
        id: "3",
        title: "Tom ",
        isEditing: "false",
        isCompelte: "true",
      },
    ];
    return (
      <div className="TodoNew">
        <Table columns={columns} dataSource={data} />
      </div>
    );
  }
}

export default TodoNew;
